import {SONGS,ERRORS} from "../types";
import axios from "axios";

export default fetchSongs = (url)=>(dispatch)=>{
    axios.get(url)
    .then(res=>{
        dispatch({
            type:SONGS,
            payload: res.data
        })
    }).catch(err=>{
        dispatch({
            type:ERRORS,
            payload:err
        })
    })
}
